<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  
  <title></title>
 

  <link rel="stylesheet" href="/build/main.css">
  <script src="/build/main.js"></script>
</head>
<body>
  <main>
    <nav class="bg-white">
      <div class="max-w-7xl mx-auto px-2 sm:px-6 lg:px-8">
        <div class="relative flex items-center justify-between h-16">
          <div class="absolute inset-y-0 left-0 flex items-center sm:hidden">
            <!-- Mobile menu button-->
        <div class="flex-shrink-0 flex items-center">
              <img class="block lg:hidden h-8 w-auto" src="https://tailwindui.com/img/logos/workflow-mark-indigo-500.svg" alt="Workflow">
              <img class="hidden lg:block h-8 w-auto" src="https://tailwindui.com/img/logos/workflow-logo-indigo-500-mark-white-text.svg" alt="Workflow">
            </div>
          </div>
          <div class="flex-1 flex items-center justify-center sm:items-stretch sm:justify-start">
        
            
          </div>
          <div class="absolute inset-y-0 right-0 flex items-center pr-2 sm:static sm:inset-auto sm:ml-6 sm:pr-0">
 
    
            <!-- Profile dropdown -->
            <div class="flex flex-row ml-3 relative">
              <div>
                
                <button type="button" class=" flex text-sm rounded-full focus:outline-none focus:ring-2 focus:ring-offset-gray-800 focus:ring-white mr-4" id="user-menu-button" aria-expanded="false" aria-haspopup="true">
                  <span class="sr-only">Opensea</span>
                  <img class="h-8 w-8 rounded-full" src="https://outandaboutnow.com/wp-content/uploads/2021/01/Twitter-Logo.png" alt="">
                </button>
              </div>
              <div>
                
                <button type="button" class=" flex text-sm rounded-full focus:outline-none focus:ring-2 focus:ring-offset-gray-800 focus:ring-white" id="user-menu-button" aria-expanded="false" aria-haspopup="true">
                  <span class="sr-only">Opensea</span>
                  <img class="h-8 w-8 rounded-full" src="https://seeklogo.com/images/O/opensea-logo-7DE9D85D62-seeklogo.com.png" alt="">
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    
    </nav>

    <div id="minting-dapp"></div>
  </main>
</body>
</html>
